window.bookSummaryJSON = "<p><b>Contemporary fantasy in the world of </b><b><i>Strange Practice</i></b><b>, starring Dr. Greta Helsing, whose family has been keeping the supernatural community not-alive and well for generations.</b></p> <p>When Greta Helsing, doctor to the undead, is unexpectedly called to Paris to present at a medical conference, she expects nothing more exciting than professional discourse on zombie reconstructive surgery and skin disease in bogeymen - and hopefully at least one uneventful night at the Opera.&nbsp;</p> <p>Unfortunately for Greta, Paris happens to be infested with a coven of vampires - and not the civilized kind. If she hopes to survive, Greta must navigate the darkest corners of the City of Lights, the maze of ancient catacombs and mine-tunnels underneath the streets, where there is more to find than simply dead men's bones.&nbsp;</p> <p><b>Dr. Greta Helsing novels</b></p> <ul> <li><i>Strange Practice</i></li> <li><i>Dreadful Company</i></li> </ul>"; 
